import './homePage.css';

export default function HomePage() {
    return (
        <div className="homePage">
            <br/>
            <h1>Coupon System Project</h1>
            <h3>Here you will find all the best coupons available on the internet.</h3><br/>
            <button type="submit" class="btn btn-secondary btn-lg" title="Login">Login</button>
        </div>

    )
}
